import React from "react";

function Nav() {
  return (
    <form>
      <div>
        <textarea
          input="text"
          placeholder="Enter the category you want to add.."
          className="textarea"
        />
        <textarea input="text" placeholder="Enter the description.." class />
      </div>
      <input type="submit" value="Create" className="button1" />
    </form>
  );
}

export default Nav;
